export const styles = theme => ({
  container: {
    padding: theme.spacing.unit * 2,
  },
  title: {
    paddingBottom: 0,
  },
  textField: {
    width: '100%',
  },
  formControl: {
    minWidth: 120,
  },
  formControlSelect: {
    marginTop: theme.spacing.unit * 2,
    width: '100%',
  },
  wrapper: {
    marginTop: theme.spacing.unit * 2,
    display: 'flex',
    justifyContent: 'space-between',
  },
  button: {
    minWidth: 100,
  }
});
